INSERT INTO `courses` (`id`, `title`, `details`, `learning_objective`, `price`, `sale_price`, `certificate_price`, `status`, `preview_video`, `thumbnail`, `created_at`, `updated_at`) VALUES
(15, 'Inquiry Based Learning', '<p>Inquiry-based learning is an approach to learning that emphasizes the student’s role in the learning process. The focus is more on encouraging students to explore and ask questions rather than the teacher telling students what they need to know.</p>', '<ol><li>Understand Inquiry-based Learning (IBL)</li><li>Apply Inquiry-based Learning step by step</li><li>3. Identify and embody the role of a teacher in IBL</li><li>Apply the process of assessing students in IBL</li><li>Know Tips for Classroom Management for IBL classroom</li></ol>', 300, 0, 100, 'inactive', 'https://player.vimeo.com/video/349165483', 'public/images/courses/L5H20kuT8N.png', '2023-05-03 00:06:51', '2023-06-11 17:12:35'),
(16, 'Psychological Development of Students', '<p>In this course, we will talk about the importance of proper psychological development and share techniques to build empathy, self-confidence, resilience, and grit within our students.&nbsp;</p>', '<ol><li>Understand the difference between the Physical and Biological Development of children</li><li>Apply the Techniques of practicing Empathy</li><li>Identify the Techniques for practicing Confidence</li><li>Understand the Techniques for practicing resilience</li><li>Apply the techniques of practicing grit</li></ol>', 300, NULL, 0, 'inactive', 'https://player.vimeo.com/video/411969734', 'public/images/courses/9TuZNqvb3z.png', '2023-06-02 03:37:33', '2023-06-02 03:37:33'),
(17, 'Game-based Learning', '<p>Game-based learning is an approach where students explore relevant aspects of games in a learning context designed by teachers. The games teachers design are also used as a tool to help them assess students and find out students\' needs and address them.&nbsp;</p>', '<ol><li>Understand Game-based Learning (GBL)</li><li>Identify the Principles of game making</li><li>Design game-based session</li><li>Apply Subject-based games for assessment</li><li>Know the Tips for GBL Classroom Management</li><li>Realize the Importance of Empathy in Classroom</li></ol>', 0, NULL, 300, 'inactive', 'https://player.vimeo.com/video/348522825', 'public/images/courses/veunbbAFNp.png', '2023-06-02 03:41:55', '2023-06-11 17:15:39'),
(18, 'Problem-based Learning', '<p>Problem-based Learning (PbL) is a student-centered approach that presents students with real-life issues and gives them the opportunity to well thought out and constructed solutions to the issue.&nbsp;</p>', '<ol><li>Understand Problem-based Learning (PBL)</li><li>Identify the Structure of Problem-based Learning</li><li>Identify and embody the role of a teacher in PBL</li><li>Apply the process of assessing students in PBL</li><li>Know Tips for Classroom Management for IBL classroom</li></ol>', 300, 0, 0, 'inactive', 'https://player.vimeo.com/video/350684060', 'public/images/courses/Txe7vKMxU5.png', '2023-06-10 14:13:38', '2023-06-11 17:19:07'),
(19, '21st Century Classroom', '<p>The 21st Century classroom is student-centered, not teacher-centered. In these classrooms, teachers are the facilitators of learning. The students learn by doing, and the teacher acts as a coach, helping students as they work on projects.&nbsp;</p>', '<p>1. Identify the Characteristics of Teacher-led classroom<br>2. Identify and embody the Positive and Negative sides of teacher-led classroom<br>3. Understand the Characteristics of student-led classroom<br>4. Ensure the Skill development of students by establishing student-led classroom<br>5. Apply the Process of establishing a student-led classroom</p>', 300, NULL, 0, 'active', 'https://player.vimeo.com/video/406770914', 'public/images/courses/Ef5OpPsU9a.png', '2023-06-10 14:16:24', '2023-06-14 05:46:18'),
(20, 'Class Management', '<p>In this course, we will talk about different aspects of classroom management which includes preventative and corrective measures as well as the importance of building good relationships with student.&nbsp;</p>', '<p>1. Learn the value of building a positive student-teacher relationship<br>2. Apply classroom rules as a way of Behavior Management<br>3. Apply preventive steps for Class Management<br>4. Apply corrective steps for Class Management<br>5. Understand the effectiveness of Collaborative for classroom management<br>6. Understand the importance of Reward and motivation for classroom management<br>7. Learn the importance of self-care</p>', 300, NULL, 0, 'active', 'https://player.vimeo.com/video/411943105', 'public/images/courses/y5ulUfwFgL.png', '2023-06-10 14:21:01', '2023-06-14 06:13:04'),
(21, 'Math Pedagogy', '<p>In this course, we will show different interactive methods to teach math in the classroom.&nbsp;</p>', '<ol><li>Use interactive methods to teach Geometry&nbsp;</li><li>Apply interactive methods to teach Addition &amp; Subtraction</li><li>Use modern pedagogy to teach the concepts of Number</li><li>Apply pedagogy to build concepts on Time and measurement</li><li>Design interactive teaching strategies to teach Multiplication&nbsp;</li></ol>', 300, 0, 0, 'inactive', 'https://player.vimeo.com/video/557680287', 'public/images/courses/AvqaUkuSpT.png', '2023-06-10 14:23:27', '2023-06-11 15:22:19'),
(22, 'Early Childhood Development', '<p>In this course, we will discuss the impact of Early childhood education. We will discuss how to expand and cultivate children\'s skills and assess their needs and finally how to help them develop based on this understanding.</p>', '<p>1. Know about Early Childhood Development (ECD)&nbsp;<br>2. Learn about the objectives of ECD<br>3. Ensure Physical and motor development of Children<br>4. Ensure Socio-emotional Development of Children<br>5. Ensure Cognitive development of Children<br>6. Ensure Language Development of Children<br>7. Apply the Techniques to cater to Children with special abilities and disabilities<br>8. Apply the methods and materials to promote ECD<br>9. Learn to apply Activities for children and teachers to ensure ECD<br><br>&nbsp;</p>', 300, 0, 0, 'inactive', 'https://player.vimeo.com/video/562635370', 'public/images/courses/4cHtqYy1RB.png', '2023-06-10 14:25:17', '2023-06-10 14:25:17'),
(23, 'Critical Thinking', '<p>In this course, we will show the importance of critical thinking and develop this skill in children through education from an early age.</p>', '<p>1. Understand the concept of Critical thinking&nbsp;</p><p>2. Identify Artful thinking<br>3. Apply Artful thinking in a subject 4. Explain See-Think-Wonder Routine<br>5. Understand the game routine<br>6. Identify 5X2 Organizer routine<br>7. Know about \'What makes you say that\' routine<br>8. Know about Beginning- Middle- End routine<br>9. Know about \'Each student in thinking\' routine<br>10. Know about \'Boost thinking\' routine<br>&nbsp;</p>', 300, NULL, 0, 'active', 'https://player.vimeo.com/video/559855071', 'public/images/courses/qdgqYzGEPF.png', '2023-06-10 14:27:49', '2023-06-14 06:20:09'),
(24, 'Effective English Teaching', '<p>In this course, you will learn the best way to enhance your students learning in reading, writing, listening, and speaking.</p>', '<ol><li>Identify the techniques and activities for teaching English</li><li>Apply fun ways to teach in English in Classroom</li><li>Understand the importance of interactive methods for making English assessments interesting&nbsp;</li></ol>', 300, 0, 0, 'inactive', 'https://player.vimeo.com/video/559549196', 'public/images/courses/1b3UEErOj4.png', '2023-06-10 14:31:06', '2023-06-11 15:13:43'),
(25, 'ADHD', '<p>In this course, you will learn about ADHD, its types, symptoms as well as diagnosis. After this course, as a parent or a teacher, you will learn practical strategies to ensure children with ADHD don\'t get excluded from mainstream education.&nbsp;</p>', '<p>1. Know the concept of ADHD<br>2. Understand different Types of ADHD<br>3. Identify Signs and Symptoms of ADHD<br>4. Know Tips and Guidelines for the parents<br>5. Comprehend the importance of Diagnosing ADHD in Children<br>6. Apply Classroom Strategies for Students with ADHD<br>7. Apply Teaching Strategies for Students with ADHD<br>8. Apply Activities for Kids With ADHD<br>9. Apply Art Therapy Techniques for ADHD Students<br>&nbsp;</p>', 300, NULL, 0, 'active', 'https://player.vimeo.com/video/573974963', 'public/images/courses/bBIB4KSyRa.png', '2023-06-10 14:32:54', '2023-06-14 05:46:49'),
(26, 'Learning Disability', '<p>In this course, you will understand different learning disabilities, their types, and their symptoms. This course would help you design a classroom according to different learners\' abilities and suggest ways to make them active learners.</p>', '<p>1. Understand the concept of Learning Disability<br>2. Understand the Symptoms, Challenges &amp; Scaffolds of Dyslexia&nbsp;<br>3. Identify the Symptoms, Challenges &amp; Scaffolds of Dysgraphia<br>4. Identify the Symptoms, Challenges &amp; Scaffolds of Dyscalculia<br>5. Recognize the Symptoms, Challenges &amp; Scaffolds of Dyspraxia<br>&nbsp;</p>', 300, 0, 0, 'inactive', 'https://player.vimeo.com/video/568390110', 'public/images/courses/rVhDljM5qu.png', '2023-06-10 14:34:31', '2023-06-10 14:34:31'),
(27, 'Foundation of Interactive Teaching Part 1', '<p>This course is an introductory course on interactive teaching that will explore essential education concepts, teaching, curriculum, learning objectives, and monitoring evaluation. This course is a must for young teachers who look forward to becoming efficient teachers.</p>', '<p>1. Understand the concept of Education<br>2. Identify 4 stages of teaching<br>3. Become Effective and Efficient Teachers<br>4. Establish Positive Expectations<br>5. Identify the Educational standard and Curriculum<br>6. Understand the Learning and Lesson Objective<br>7. Importance of effective Feedback and Assessment<br>8. Apply the assessment Rubric<br>&nbsp;</p>', 300, 0, 0, 'inactive', 'https://player.vimeo.com/video/573585987', 'public/images/courses/YWUTKn5h1F.png', '2023-06-10 14:36:09', '2023-06-10 14:36:09'),
(28, 'Life Skill Development of Students', '<p>Developing life skills is essential for every child and should be continuously developed starting from childhood. This course will help teachers to positively contribute to this journey with their students.</p>', '<p>1. Understand the Importance of Life Skill Development&nbsp;<br>2. Introduce Safe &amp; Unsafe Touch to students&nbsp;<br>3. Prevent Bullying in the classroom&nbsp;<br>4. Establish Positive Body Image in Classroom&nbsp;<br>5. Promote Emotional Intelligence among Students&nbsp;<br>6. Introduce Gender equality in Classroom&nbsp;<br>7. Promote Peace and Tolerance in Classroom</p>', 300, 0, 0, 'inactive', 'https://player.vimeo.com/video/604609104', 'public/images/courses/DA0bcMQfCh.png', '2023-06-10 14:38:32', '2023-06-10 14:38:32'),
(29, 'Bekaron shekhanor Mojar Poddhoti 1', '<p>“ব্যাকরণ শেখানোর মজার পদ্ধতি -১” কোর্সটিতে বাংলা ব্যাকরণের ধ্বনি, বর্ণ, শব্দ, সন্ধি, বচন, লিঙ্গ,সমাস ও কারক শিক্ষার্থীদের কাছে আকর্ষণীয় ভাবে উপস্থাপন করার পদ্ধতি সম্পর্কে আলোচনা করেছে।</p>', '<ol><li>Understand the importance of Interactive Game-based learning (GBL) for teaching Bangla Grammar</li><li>Apply GBL to teach ধ্বনি, বর্ণ, শব্দ, সন্ধি, বচন, লিঙ্গ,সমাস and কারক</li><li>Understand the importance of GBL in Bangla Grammer Teaching</li></ol>', 300, NULL, 0, 'active', 'https://player.vimeo.com/video/580568958', 'public/images/courses/7hesAg64YU.png', '2023-06-10 15:09:54', '2023-06-14 05:45:54'),
(30, 'Bekaron shekhanor Mojar Poddhoti 2', '<p>“ব্যাকরণ শেখানোর মজার পদ্ধতি -২” কোর্সটি থেকে আপনারা জানতে পারবেন কিভাবে পদ প্রকরণ,পদ পরিবর্তন, ক্রিয়ার কাল, বাক্য প্রকরণ ও ভাষার বিভিন্ন রীতির মতো বাংলা ব্যাকরণের টপিকগুলো সহজ ও আকর্ষণীয় করে</p>', '<ol><li>Understand the importance of Interactive Game-based learning (GBL) for teaching Bangla Grammar</li><li>Apply GBL to teach পদ প্রকরণ,পদ পরিবর্তন, ক্রিয়ার কাল, বাক্য প্রকরণ and ভাষার বিভিন্ন রীতির</li><li>Value the importance of GBL in Bangla Grammer Teaching</li></ol>', 300, NULL, 0, 'active', 'https://player.vimeo.com/video/580569288', 'public/images/courses/GvH0R5NTIo.png', '2023-06-10 15:13:07', '2023-06-14 05:47:50'),
(31, 'Social-Emotional Learning', '<p>This course explores the concept of social-emotional learning, its necessity, different components of social-emotional learning, and how to implement those through different activities in the classroom. This course is a must for teachers who look forward to building a strong relationship with their students.</p>', '<p>1. Understand the concept of Social-Emotional learning&nbsp;<br>2. Understand the necessity and benefits of Social-Emotional learning<br>3. Promote Empathy in Classroom through activities<br>4. Apply different social-emotional skills and ways to implement&nbsp;<br>5. Assess and monitor the outcome of SEL activities&nbsp;</p>', 300, NULL, 0, 'active', 'https://player.vimeo.com/video/603724641', 'public/images/courses/3jjowxhcuT.png', '2023-06-10 15:18:02', '2023-06-14 05:47:24'),
(32, 'Blended Learning-1', '<p>This course will help teachers understand the concept of blended learning, the nature, classroom models, and realistic scenarios for implementing and applying blended learning models in their classrooms.&nbsp;</p>', '<p>1. Describe and explain the concept of Blended Teaching-Learning<br>2. Identify and realize the benefits of Blended Learning<br>3. Identify and explain different models of Blended Learning&nbsp;</p>', 300, NULL, 0, 'active', 'https://player.vimeo.com/video/608732648', 'public/images/courses/0PkIoIjxKI.png', '2023-06-10 15:21:56', '2023-06-14 05:52:04'),
(33, 'Blended Learning 2', '<p>This course will help teachers understand the concept of blended learning, the nature, classroom models, and realistic scenarios for implementing and applying blended learning models in their classrooms.&nbsp;</p>', '<ol><li>Identify Technologies for Blended Learning</li><li>Use Google Tools to take Blended Class</li><li>Conduct Blended mode classes effectively Using Technology and Pedagogy</li></ol>', 300, NULL, 0, 'active', 'https://player.vimeo.com/video/608772522', 'public/images/courses/sQvbn6GkXv.png', '2023-06-10 15:25:09', '2023-06-14 05:54:17'),
(34, 'Effective Instructions in English', '<p>This course will help teachers to understand the mechanism of Effective Instruction and the usage of Effective Instruction in Academic, Class Management, and Assessment.&nbsp;</p>', '<p>1. Understand and deliver Effective Instruction in the English language<br>2. Understand the Fundamental rules of Effective Instruction<br>3. Apply Effective Instruction on Questionpapers&nbsp;<br>&nbsp;</p>', 300, 0, 0, 'inactive', 'https://player.vimeo.com/video/667646326', 'public/images/courses/znMZTGLJVT.png', '2023-06-10 15:27:03', '2023-06-10 15:27:03'),
(35, 'Online Class Management', '<p>This course will help teachers to understand the issues and reasons behind online class mismanagement and apply effective strategies to conduct managerial interventions for an interactive online class.</p>', '<ol><li>Understand the importance of Online Class Management and the issues in an online class</li><li>Apply Interactive teaching methods for students\' greater engagement</li><li>Create a safe learning environment for students&nbsp;</li><li>Design assessment and feedback session for students engagement</li><li>Design on-camera and off-camera activities for student engagement</li><li>Make online classrooms exciting&nbsp;</li></ol>', 300, 0, 0, 'inactive', 'https://player.vimeo.com/video/678600211', 'public/images/courses/09rptG9msq.png', '2023-06-10 15:29:20', '2023-06-11 15:42:32'),
(36, 'Student Need-based Learning', '<p>This course will help teachers to cater to students\' learning needs and ensure equity in the classroom.&nbsp;</p>', '<p>1. Will understand the importance of Student Need-based Learning<br>2. Will be able to identify students learning needs<br>3. Will be able to cate students\' learning needs in real-time classroom<br>4. Will be able to use ABCDE framework to apply Student Need-based or Differentiation learning method<br>5. Will be able to differentiate content, process, product, and environment to ensure equity in the classroom</p>', 300, 0, 0, 'inactive', 'https://player.vimeo.com/video/709025739', 'public/images/courses/GLUYyBEnXl.png', '2023-06-10 15:31:11', '2023-06-11 15:38:11'),
(37, 'Testing 01', '<p>wfef</p>', '<p>wef</p>', 300, 200, 200, 'inactive', 'https://player.vimeo.com/video/349165483', 'public/images/courses/0ZaXhLThKC.png', '2023-06-11 12:27:14', '2023-06-11 12:27:14');
