INSERT INTO `faculties` (`id`, `first_name`, `last_name`, `details`, `dp`, `created_at`, `updated_at`) VALUES
(3, 'Saraf Afra', 'Salsabil', '<p>Saraf Afra Salsabil completed Bachelor of Education and Masters of Science, Mathematics and Technology Education Institute of Education and Research University of Dhaka. She is currently a Curriculum and Instructional Specialist at Alokito Teachers. Previously, with her specialization in Science, Technology, Engineering and Mathematics (STEM) and experience in online-course designing she has worked with Spider Digital Venture for their e-learning platform. She is also a blogger at Sex Education Bangladesh.</p>', 'public/images/faculties/QUbuedYj3b.png', '2023-03-11 07:46:39', '2023-03-11 10:27:01'),
(4, 'Azwa', 'Nayeem', '<p>Azwa Nayeem is a social entrepreneur. She was a lecturer (Adjunct) at North-South University in the Department of Political Science and Sociology. Azwa is a Global Shaper, World Economic Forum and she is trained in Leadership from Harvard Kennedy School. She completed her Master of International Relations from the University of New South Wales and Master in Development Studies from BRAC University.</p>', 'public/images/faculties/TIC0TFjSic.png', '2023-03-11 10:28:41', '2023-03-11 10:28:41'),
(5, 'Testing', 'Testing', '<p>testing</p>', 'public/images/faculties/lybV04wrFu.png', '2023-06-01 19:13:15', '2023-06-01 19:13:15'),
(6, 'Testing 2', 'Testing 2', '<p>dqwewef</p>', 'public/images/faculties/DdntOp6NA2.png', '2023-06-01 19:18:17', '2023-06-01 19:18:17'),
(7, 'Kazi', 'K. Shahidullah, PhD', '<p>Dr. Kazi K. Shahidullah has a Ph.D. in Curriculum, Teaching, &amp; Learning from Nevada, U.S.A. He is the Founder &amp; President of STEM Bangladesh. Currently, he is working as an Assistant Professor of Curriculum Development and Evaluation Office of the Evaluation, Faculty, and Curriculum Development (OEFCD) at Bangladesh University of Professionals (BUP).</p>', 'public/images/faculties/2mK5pDa83W.png', '2023-06-02 03:05:32', '2023-06-02 03:05:32'),
(8, 'Zeeshan', 'Zakaria', '<p>Zeeshan Zakaria is a dedicated, accommodating and versatile educator, constantly reinventing to ensure every child makes progress and achieves to the best of their ability. He is the Executive Director of Alokito Hridoy Foundation and the Co-Founder and COO of Shikho Technologies. He believes that with the right application of pedagogy and a well-balanced combination of synchronous learning approaches, we can truly change the way Bangladesh learns.</p>', 'public/images/faculties/2HcChA5gZQ.png', '2023-06-02 03:06:48', '2023-06-02 03:06:48'),
(9, 'GM Rakibul', 'Islam', '<p>G M Rakibul Islam has expertise in designing education projects, researching educational issues, integrating ICT in Education, and developing teachers’ capacity. He is an Assistant Professor and Chairman (Acting) of the Department of Educational Administration at Noakhali Science and Technology University (NSTU) where he is developing future leaders and managers for the education sector. He has completed his MA in Educational Leadership from the University of Manchester and has worked with the a2i program of the Prime Minister’s Office, Ministry of Education of Bangladesh.</p>', 'public/images/faculties/IaaW7f1UUd.png', '2023-06-02 03:08:32', '2023-06-02 03:08:32'),
(10, 'Azwa', 'Nayeem', '<p>Azwa Nayeem is an educator and social entrepreneur. She has founded Alokito Hridoy Foundation with the hopes of understanding the deep-seated problems that prevent effective delivery of quality education at scale. Her foundation runs as an education innovation hub consisting of Alokito Hridoy School for underserved communities and a nationwide platform for teacher development. There she tests, contextualizes and fine-tunes teaching-learning approaches to create 21st century teachers and classroom experience at scale.&nbsp;</p>', 'public/images/faculties/mXVMYnjlhn.png', '2023-06-02 03:13:59', '2023-06-02 03:13:59'),
(11, 'Syeda', 'Tasnima', '<p>Syeda Tasnima is a Director at Alokito Hridoy Foundation. She completed her Masters in Development Studies at BRAC University. She is a staff researcher at the Institute of Educational Development, BRAC University. She was also a teacher at Sunbeams School in Dhaka.&nbsp;</p>', 'public/images/faculties/k5XdQWfZd5.png', '2023-06-02 03:14:51', '2023-06-02 03:14:51'),
(12, 'Saiful', 'Islam Talukder', '<p>Saiful Islam Talukdar was the Education Development Officer at Alokito Hridoy Foundation. He completed a Bachelor of Education and Master of Education from the Institute of Education and Research, University of Dhaka. With a specialization in Science, Technology, Engineering, and Mathematics (STEM) Education, he has worked to promote the Science Education Programme of UNICEF under National Curriculum Textbook Board (NCTB).&nbsp;</p>', 'public/images/faculties/QwA8gdaI6d.png', '2023-06-02 03:15:48', '2023-06-02 03:15:48'),
(13, 'Patricia', 'Gomes', '<p>Partrica Gomez is the former teacher trainer Program Manager at Alokito Hridoy Foundation. She used to be a life skill trainer at StepUP Foundation. She has over 7 years of experience as a teacher and was a teacher at Sir John Wilson School.</p>', 'public/images/faculties/q3WofJ7awV.png', '2023-06-02 03:16:31', '2023-06-02 03:16:31'),
(14, 'Adiba', 'Karim', '<p>Adiba Karimis the former teacher trainer and Communications Manager at Alokito Hridoy Foundation. She has over 6 years of experience as a teacher and was a teacher at Scholars’ School and College. She completed her Master\'s in Economics at United International University.</p>', 'public/images/faculties/2mGZiIsUKG.png', '2023-06-02 03:17:16', '2023-06-02 03:17:16'),
(15, 'Kazi', 'Sadika Noor', '<p>Kazi Sadika Noor is currently the Operations and Liaison Manager at Alokito Teachers. She diligently organizes, coordinates and oversees multiple projects and programs. She has a Masters in Development Studies from Brac University. She is passionate about providing education for the underprivileged and disadvantaged communities in Bangladesh and is working towards achieving that goal.</p>', 'public/images/faculties/8NvmdsLUcn.png', '2023-06-02 03:17:55', '2023-06-02 03:17:55'),
(16, 'Farin', 'Daulah', '<p>Farin Daulah is the founder and president of One Circle. She is a trained education professional from the UK and has a degree in Education &amp; English from the University of Surrey. She also holds a Masters in Management from Westminster University. She has extensive experience in the life-skills education sector, working in various schools and non-profit organizations in London.</p>', 'public/images/faculties/kQFrDd9BGm.png', '2023-06-02 03:18:43', '2023-06-02 03:18:43'),
(17, 'Prof. M. Nazmul', 'Haq', '<p>M. Nazmul Haq was a Professor of Education in the Institute of Education and Research (IER), University of Dhaka. He completed his Masters Degrees from Dhaka University in Psychology and Education. He also obtained another M. A. in Research Methodology from University of Exeter, UK. Currently he is holding the post of Honorary Professor of IER at Dhaka University. And heading the Teacher Development Institute, Dhaka.</p>', 'public/images/faculties/9NxC3uMjxt.png', '2023-06-02 03:19:36', '2023-06-02 03:19:36'),
(18, 'Jahanara', 'Jabbar', '<p>Jahanara Jabbar is the Course Instructor- O\' level &amp; A level English Language (Cambridge &amp; Edexcel). Her professional teaching experience is over 17 years. She completed her Masters in English Literature from Jahangirnagar University and Masters in English Language Teaching from Dhaka University.&nbsp;</p>', 'public/images/faculties/X2S5e6rfcr.png', '2023-06-02 03:21:23', '2023-06-02 03:21:23'),
(19, 'Shanaj Parvin', 'Jonaki', '<p>Shanaj Parvin Jonaki completed a Bachelor of Education and a Master of Education from the Institute of Education and Research, University of Dhaka. She is currently a Monitoring, Evaluation, and Learning Officer at Alokito Hridoy foundation. Previously, with her specialization in Primary Education and Educational Psychology, she has worked to promote diversity and inclusive education as part of \"Amader Golpo\" (comic book for children) under the \'Diversity for Peace\' initiative of UNDP. Jonaki is passionate about reducing learning inequalities and making quality education accessible to all students by developing quality teachers.</p>', 'public/images/faculties/rzXmiayqEO.png', '2023-06-02 03:22:44', '2023-06-02 03:22:44'),
(20, 'Saraf Afra', 'Salsabil', '<p>Saraf Afra Salsabil completed Bachelor of Education and Masters of Science, Mathematics and Technology EducationInstitute of Education and Research University of Dhaka. She is currently a Curriculum and Instructional Specialist at Alokito Teachers. Previously, with her specialization in Science, Technology, Engineering and Mathematics (STEM) and experience in online-course designing she has worked with Spider Digital Venture for their e-learning platform. She is also a blogger at Sex Education Bangladesh.&nbsp;</p>', 'public/images/faculties/gcYc4HjeiB.png', '2023-06-02 03:23:58', '2023-06-02 03:23:58'),
(21, 'Shahnnawaz', 'Ayon', '<p>Shahnawaz Ayon is currently the Program Officer at Green Sparks where he is designing and conducting Educational workshop. He is also the former Educational Development Officer of Alokito Hridoy Foundation. Shahnawaz Ayon has a Postgraduate diploma on Educational Leadership from Brac University.</p>', 'public/images/faculties/JfAaQafpca.png', '2023-06-02 03:24:48', '2023-06-02 03:24:48'),
(22, 'Sharmin', 'Easha', '<p>Sharmin Easha is the Early Childhood Development Specialist at Light of Hope. She completed both her Masters and her Bachelors in Education from the Institute of Education and Research, University of Dhaka.&nbsp;</p>', 'public/images/faculties/zjM8rkaAUD.png', '2023-06-02 03:25:39', '2023-06-02 03:25:39'),
(23, 'Fawzia', 'Chowdhury', '<p>Fawzia Chowdhury has extensive experience in teaching, career counseling and school management. She has over twelve years of experience as a senior manager of the secondary section at the Aga Khan School. She is currently a private tutor for O’ Level and. A’ Level students.</p>', 'public/images/faculties/G3dR8x9d0q.png', '2023-06-02 03:26:25', '2023-06-02 03:26:25'),
(24, 'Minnat', 'Khan', '<p>Minnat Khan is an Early Childhood Teacher for the International School, Dhaka (ISD) for the last 14 years. Her expertise lies in Early Childhood Development, teacher training and classroom management, elementary education and many more. She completed her Early Childhood Education and Teaching from Sheridan College, Ontario, Canada.</p>', 'public/images/faculties/B76OQXAfRy.png', '2023-06-02 03:27:13', '2023-06-02 03:27:13'),
(25, 'Tasleema', 'Begum', '<p>Tasleema Begum is a highly experienced and meticulous teacher trainer/training specialist with vast experience working with both primary and secondary teachers. She has conducted many teachers\' training and conceptualizes training materials based on curriculum expectations. She has a strong background in building and maintaining a wide variety of educational materials, effectively able to mentor and lead. She also has an excellent record of conducting outreach teachers training programmes.&nbsp;</p>', 'public/images/faculties/Wj3CC7qzg2.png', '2023-06-02 03:28:35', '2023-06-02 03:28:35');
