INSERT INTO `questions` (`id`, `question`, `sequence`, `option_1`, `option_2`, `option_3`, `option_4`, `answer`, `points`, `quiz_id`, `created_at`, `updated_at`) VALUES
(37, '১। UNICEF বলে...............', 1, 'Teacher-led classroom-ই উত্তম কেননা শিক্ষার্থীদের নিজের থেকে কিছু করা কষ্টকর হয়ে যাবে', 'অভিভাবকরা Teacher-led classroom-এ তাদের সন্তানদের পাঠাতে স্বাচ্ছন্দ্যবোধ করে', 'প্রতিটি শিক্ষার্থী কোন কিছু শোনা বা দেখার থেকে নিজে কিছু করার মাধ্যমে ভালো ভাবে শিখতে পারে', 'শিক্ষকের উচিত শিক্ষার্থীদের সবসময় সাহায্য করা যেন তাদের শিখন যাত্রাটি সফল হয়', 3, 1, 11, '2023-06-12 02:27:37', '2023-06-12 02:32:07'),
(38, '২। একটি Teacher-led classroom দেখতে কেমন হয়?', 2, 'যেখানে শিক্ষক তার নির্দেশনা অনুযায়ী তার ক্লাসটি এগিয়ে নিয়ে যাচ্ছে', 'যেখানে শিক্ষার্থী এবং শিক্ষক উভয় মিলে ক্লাসের নির্দেশনা দিচ্ছে', 'যেখানে ইন্টারনেটে দেখে শিক্ষার্থীরা নিজে নিজে একটি বিষয় সম্পর্কে পড়ছে', 'যেখানে শিক্ষক শুধু মাত্র একজন গাইড হিসাবে আছেন', 1, 1, 11, '2023-06-12 02:28:40', '2023-06-12 02:32:21'),
