(213, 'সুন্দর সম্পর্ক তৈরী করার পূর্বশর্ত কোনটি?', 8, 'নিজের অনুভূতির কথা বলতে পারা', 'অন্যের কথা মনযোগ দিয়ে শুনতে পারা', 'পরামর্শ দিতে পারা', 'কোনটি-ই নয়', 2, 1, 39, '2023-06-14 05:23:06', '2023-06-14 05:23:06'),
